    //      newdata[e.target.id] = e.target.value 
    //      setData(newdata)
    //      console.log(newdata)

    //     }
  

    return (
        <div className='studyabroad'>
            <div className='studyabroad_inner'>
                <div className='studyabroad_title'>
                 <h1 className='stdabrdh1'>Interested in Studying Abroad ?</h1>
                  </div>
                 <div className='studyabroad_heading'>
                 <h3 className='stdabdheadthree'>IIEC can help – fill in your details<br/> and we’ll call you back.</h3>
                 </div>
             
                  <input  id="studyabroadscom Firstname"   className='studyabroad_input ' onChange={(e)=>handle(e)} value={data.Firstname} placeholder='Firstname'   ></input>
                  <input id="studyabroadscom" className='studyabroad_input' onChange={(e)=>handle(e)} value={data.Lastname} placeholder='Lastname'></input>
                  <input id="studyabroadscom" className='studyabroad_input' onChange={(e)=>handle(e)} value={data.EmailId} placeholder='EmailId'></input>
                  <input id="studyabroadscom" className='studyabroad_input' placeholder='Mobilenumber'></input>
                  <input id="studyabroadscom" className='studyabroad_input' placeholder='Your preferred study destination'></input>
                  <input id="studyabroadscom" className='studyabroad_input' placeholder='Your preferred study destination'></input>
                  <input id="studyabroadscom" className='studyabroad_input' placeholder='Nearest IIEC office'></input>
                  <input id="studyabroadscom" className='studyabroad_input' placeholder='Preferred mode of counselling'></input>
                  <input id="studyabroadscom" className='studyabroad_input' placeholder=' How would you fund your education?'></input>
                  <input id="studyabroadscom" className='studyabroad_input' placeholder='Preferred study level?'></input>
             
                  <div className='studybottomheading'>
                 <h3>IIEC will not share your details with others without your permission:
                 </h3></div>
                 <ul className='listitemsstudyabrd'>
                     <li className='listitemsstudyabrdli'><input className='checkboxforstudyabroad' type="checkbox"/>I agree to IDP Terms and privacy policy </li><br></br>
                     <li className='listitemsstudyabrdli'><input className='checkboxforstudyabroad' type="checkbox"/>Please contact me by phone, email or SMS to assist with my enquiry</li><br></br>
                     <li className='listitemsstudyabrdli'><input className='checkboxforstudyabroad' type="checkbox"/> would like to receive updates and offers from IIEC</li>
                     
                 </ul>
                 
                  <button className='register_button'>Register Now</button>
             </div>
        </div>
    )
}


export default StudyAbroad ;
